import LoggedinContainer from "../containers/Loggedincontainers";

const Library = () => {
    return (

        <LoggedinContainer currentactivescreen="library" >
                <div className="text-white text-xl pt-8">
                    My Playlist
                </div>
                <div className="pt-4">
                    <Card title="Title" description="" imgurl="https://marketplace.canva.com/EAFWz37wwl0/1/0/1600w/canva-black-minimalist-photocentric-rose-on-fire-hip-hop-album-cover-laJL2q01ZUU.jpg" />
                </div>
        </LoggedinContainer>
    )
}

const Card = ({ title, description, imgurl }) => {
    return (
        <div className="bg-black bg-opacity-50 w-1/5 p-4 rounded-lg">
            <div className="py-4">
                <img className="w-full rounded-md" alt="card" src={imgurl} />
            </div>
            <div className="text-white  py-3">{title}</div>
            <div className="text-gray-500 text-sm">{description}</div>

        </div>
    );
};


export default Library;
